import React, { useState } from "react";
import "./Query.css"; // Your CSS file for styling

const Query = () => {
  const [formData, setFormData] = useState({
    // ... (unchanged)
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData); // For demonstration, log the form data
    // Perform form submission logic here
  };

  return (
    <div className="form-wrapper">
        <span className="form-title">Query Sheet</span>
      <div className="form-container">
        <form className="form" onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="name">Name:*</label>
            <input
              type="text"
              id="name"
              name="name"
              required
              value={formData.name}
              onChange={handleChange}
            />
          </div>

          <div className="form-group">
            <label htmlFor="designation">Designation:*</label>
            <input
              type="text"
              id="designation"
              name="designation"
              required
              value={formData.designation}
              onChange={handleChange}
            />
          </div>
          <div className="form-group">
            <label htmlFor="name">Organization:</label>
            <input
              type="text"
              id="name"
              name="name"
              required
              value={formData.organization}
              onChange={handleChange}
            />
          </div>
          <div className="form-group">
            <label htmlFor="name">Office Address:</label>
            <input
              type="text"
              id="name"
              name="name"
              required
              value={formData.officeAddress}
              onChange={handleChange}
            />
          </div>
          <div className="form-group">
            <label htmlFor="name">City:</label>
            <input
              type="text"
              id="name"
              name="name"
              required
              value={formData.city}
              onChange={handleChange}
            />
          </div>
          <div className="form-group">
            <label htmlFor="name">Email Address:</label>
            <input
              type="text"
              id="name"
              name="name"
              required
              value={formData.emailAddress}
              onChange={handleChange}
            />
          </div>
          <div className="form-group">
            <label htmlFor="name">Telephone no.:</label>
            <input
              type="text"
              id="name"
              name="name"
              value={formData.telephoneNo}
              onChange={handleChange}
            />
          </div>
          <div className="form-group">
            <label htmlFor="name">Mobile Number:</label>
            <input
              type="text"
              id="name"
              name="name"
              required
              value={formData.mobileNumber}
              onChange={handleChange}
            />
          </div>
          <div className="form-group">
            <label htmlFor="professionalUpdates">
              Other Professional Updates:
            </label>
            <div className="radio-buttons">
              <label>
                <input
                  type="radio"
                  name="professionalUpdates"
                  value="Yes"
                  checked={formData.professionalUpdates === "Yes"}
                  onChange={handleChange}
                />{" "}
                Yes
              </label>
              <label>
                <input
                  type="radio"
                  name="professionalUpdates"
                  value="No"
                  checked={formData.professionalUpdates === "No"}
                  onChange={handleChange}
                />{" "}
                No
              </label>
            </div>
          </div>

          {/* Add pairs of fields accordingly */}

          <div className="form-group">
            <label htmlFor="querySubject">Subject of Query:*</label>
            <select
              id="querySubject"
              name="querySubject"
              value={formData.querySubject}
              onChange={handleChange}
              required
            >
              {/* Options for the dropdown */}
            </select>
          </div>
          <div className="form-group">
            <label htmlFor="query">Query:*</label>
            <textarea
              id="query"
              name="query"
              value={formData.query}
              onChange={handleChange}
              required
            ></textarea>
          </div>
        </form>
        <button type="submit">Submit</button>
      </div>
    </div>
  );
};

export default Query;
